      "content": "// SPDX-License-Identifier: MIT\npragma solidity 0.8.25;\n\ncontract Withdraw {\n\n    error Fail();\n\n    address public immutable owner;\n\n    constructor() {\n        owner = msg.sender;\n        withdraw();\n    }\n\n    function withdraw() public {\n        (bool success, ) = owner.call{value: address(this).balance}(\"\");\n        if (!success) {\n            revert Fail();\n        }\n    }\n}"
